// data/svgItems.js
import headphone from "../assets/headphone.svg";
import interface1 from "../assets/interface.svg";
import money from "../assets/money.svg";
import lock from "../assets/lock.svg";

const svgItems = [
  { image: headphone, title: "پشتیبانی آنلاین", subtitle: "پاسخگویی و راهنمایی کاربران توسط کارشناسان تم ایکس در محیط وب سایت و اپلیکیشن موبایل" },
  { image: interface1, title: "رابط کاربری آسان", subtitle: "قابلیت خرید و فروش در وب سایت، نرم افزار موبایل و ربات تلگرامی با محیطی ساده، روان و کاربرپسند" },
  { image: money, title: "قیمت منصفانه", subtitle: "ارائه قیمت های مناسب با ایجاد فضایی رقابتی در خرید و فروش جهت رضایتمندی حداکثری کاربران" },
  { image: lock, title: "امنیت در معاملات آنلاین", subtitle: "استفاده از آخرین استانداردهای امنیتی وب با انجام آزمون‌های دوره‌ای نفوذ توسط کارشناسان معتبر هک و امنیت" },
];

export default svgItems;
